import styled from "styled-components/native";
import { View } from "react-native";

const positionVariant = {
  top: "marginTop",
  left: "marginLeft",
  right: "marginRight",
  bottom: "marginBottom",
};

export const Spacer = styled(View)`
  ${(props) => {
    return css`
      background-color: black;
      color: white;
      ${Input}:checked + && {
        color: blue;
      }
    `;
  }}
`;
